import React, { useState, useEffect } from 'react';
import { Calendar, Clock, ChevronRight, ArrowRight, Book, Award, Briefcase, Code, Graduation, Filter, ExternalLink } from 'lucide-react';

const Timeline = () => {
  const [selectedFilter, setSelectedFilter] = useState('all');
  const [visibleMilestones, setVisibleMilestones] = useState([]);
  const [isLoading, setIsLoading] = useState(true);

  const milestones = [
    {
      date: "2024",
      title: "Senior Software Engineer at Orange Health",
      description: "Led development of major features and mentored junior developers",
      category: "work",
      icon: <Briefcase className="w-5 h-5" />,
      details: [
        "Led team of 5 developers",
        "Improved system performance by 40%",
        "Implemented CI/CD pipeline"
      ],
      links: [
        { label: "Project Demo", url: "#" },
        { label: "Case Study", url: "#" }
      ]
    },
    {
      date: "2023",
      title: "Published First Technical Blog",
      description: "Started sharing knowledge about system design and best practices",
      category: "achievement",
      icon: <Award className="w-5 h-5" />,
      details: [
        "Over 10,000 monthly readers",
        "Featured on multiple tech platforms",
        "Started weekly tech newsletter"
      ],
      links: [
        { label: "Blog", url: "#" },
        { label: "Newsletter", url: "#" }
      ]
    },
    {
      date: "2023",
      title: "Machine Learning Certification",
      description: "Completed advanced ML certification with distinction",
      category: "education",
      icon: <Graduation className="w-5 h-5" />,
      details: [
        "Specialized in Natural Language Processing",
        "Built 3 production-ready ML models",
        "Published research paper"
      ],
      links: [
        { label: "Certificate", url: "#" },
        { label: "Research Paper", url: "#" }
      ]
    },
    {
      date: "2022",
      title: "Open Source Contribution Milestone",
      description: "Contributed to major open source projects with over 100 PRs merged",
      category: "achievement",
      icon: <Code className="w-5 h-5" />,
      details: [
        "Core contributor to 3 major projects",
        "Created 2 widely-used libraries",
        "Mentored 10+ new contributors"
      ],
      links: [
        { label: "GitHub", url: "#" },
        { label: "Project Page", url: "#" }
      ]
    },
    {
      date: "2021",
      title: "Started at Cimpltech",
      description: "Joined as a Software Engineer focusing on backend development",
      category: "work",
      icon: <Briefcase className="w-5 h-5" />,
      details: [
        "Built scalable microservices architecture",
        "Reduced server costs by 35%",
        "Implemented real-time analytics"
      ],
      links: [
        { label: "Company", url: "#" },
        { label: "Projects", url: "#" }
      ]
    }
  ];

  const filters = [
    { id: 'all', label: 'All', count: milestones.length },
    { id: 'work', label: 'Work', count: milestones.filter(m => m.category === 'work').length },
    { id: 'achievement', label: 'Achievements', count: milestones.filter(m => m.category === 'achievement').length },
    { id: 'education', label: 'Education', count: milestones.filter(m => m.category === 'education').length }
  ];

  const getCategoryColor = (category) => {
    const colors = {
      work: 'blue',
      achievement: 'green',
      education: 'purple',
      project: 'orange'
    };
    return colors[category] || 'indigo';
  };

  useEffect(() => {
    setIsLoading(true);
    const filtered = selectedFilter === 'all' 
      ? milestones 
      : milestones.filter(m => m.category === selectedFilter);

    // Simulate loading for smooth transition
    setTimeout(() => {
      setVisibleMilestones(filtered);
      setIsLoading(false);
    }, 300);
  }, [selectedFilter]);

  const [expandedMilestone, setExpandedMilestone] = useState(null);

  return (
    <section id="timeline" className="py-32 bg-gray-900/50">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <h2 className="text-4xl font-bold mb-16 text-center">
          <span className="bg-gradient-to-r from-indigo-500 to-purple-500 bg-clip-text text-transparent">
            Journey
          </span>
        </h2>

        {/* Filters */}
        <div className="flex flex-wrap justify-center gap-4 mb-12">
          {filters.map((filter) => (
            <button
              key={filter.id}
              onClick={() => setSelectedFilter(filter.id)}
              className={`inline-flex items-center px-4 py-2 rounded-full text-sm transition-all duration-300 ${
                selectedFilter === filter.id
                  ? 'bg-indigo-500 text-white'
                  : 'bg-gray-800/50 text-gray-300 hover:bg-gray-700/50'
              }`}
            >
              <Filter className="w-4 h-4 mr-2" />
              {filter.label}
              <span className="ml-2 bg-gray-700/50 px-2 py-0.5 rounded-full text-xs">
                {filter.count}
              </span>
            </button>
          ))}
        </div>

        <div className="relative">
          {/* Timeline line */}
          <div className="absolute left-4 md:left-1/2 h-full w-0.5 bg-gradient-to-b from-indigo-500 to-purple-500" />

          {/* Timeline items */}
          <div className="space-y-12">
            {visibleMilestones.map((milestone, index) => (
              <div
                key={index}
                className={`relative flex items-center ${
                  index % 2 === 0 ? 'md:flex-row' : 'md:flex-row-reverse'
                } ${isLoading ? 'opacity-0' : 'opacity-100'} transition-opacity duration-500`}
              >
                {/* Timeline dot with icon */}
                <div className={`absolute left-4 md:left-1/2 w-10 h-10 rounded-full bg-${getCategoryColor(milestone.category)}-500 transform -translate-x-5 md:-translate-x-5 flex items-center justify-center shadow-lg shadow-${getCategoryColor(milestone.category)}-500/20`}>
                  {milestone.icon}
                </div>

                {/* Content */}
                <div className={`ml-16 md:ml-0 md:w-1/2 ${
                  index % 2 === 0 ? 'md:pr-16' : 'md:pl-16'
                }`}>
                  <div 
                    className={`bg-gray-800/50 backdrop-blur-xl p-6 rounded-lg border border-gray-700/50 hover:border-${getCategoryColor(milestone.category)}-500/50 transition-all duration-300 cursor-pointer`}
                    onClick={() => setExpandedMilestone(expandedMilestone === index ? null : index)}
                  >
                    <div className="flex items-center mb-2">
                      <Clock className={`w-4 h-4 text-${getCategoryColor(milestone.category)}-400 mr-2`} />
                      <span className={`text-${getCategoryColor(milestone.category)}-400`}>{milestone.date}</span>
                    </div>

                    <h3 className="text-xl font-semibold text-white mb-2 group-hover:text-indigo-400 transition-colors">
                      {milestone.title}
                    </h3>

                    <p className="text-gray-300">{milestone.description}</p>

                    {/* Expandable details */}
                    <div className={`mt-4 space-y-4 overflow-hidden transition-all duration-300 ${
                      expandedMilestone === index ? 'max-h-96 opacity-100' : 'max-h-0 opacity-0'
                    }`}>
                      <ul className="space-y-2">
                        {milestone.details.map((detail, i) => (
                          <li key={i} className="flex items-start text-gray-300">
                            <ChevronRight className={`w-4 h-4 text-${getCategoryColor(milestone.category)}-400 mr-2 mt-1 flex-shrink-0`} />
                            {detail}
                          </li>
                        ))}
                      </ul>

                      <div className="flex flex-wrap gap-3 pt-4 border-t border-gray-700/50">
                        {milestone.links.map((link, i) => (
                          <a
                            key={i}
                            href={link.url}
                            className={`inline-flex items-center px-3 py-1 rounded-full text-sm bg-${getCategoryColor(milestone.category)}-500/10 text-${getCategoryColor(milestone.category)}-400 hover:bg-${getCategoryColor(milestone.category)}-500/20 transition-colors`}
                          >
                            <ExternalLink className="w-3 h-3 mr-2" />
                            {link.label}
                          </a>
                        ))}
                      </div>
                    </div>

                    <span className={`inline-block mt-3 px-3 py-1 rounded-full text-xs bg-${getCategoryColor(milestone.category)}-500/10 text-${getCategoryColor(milestone.category)}-400`}>
                      {milestone.category}
                    </span>
                  </div>
                </div>
              </div>
            ))}
          </div>
        </div>
      </div>
    </section>
  );
};

export default Timeline;
